import {Grid} from "@mui/material";

export default function Projects() {
    return (
        <Grid container spacing={2}>
            {[1, 2, 3, 4].map(project => (
                <Grid item xs={12} md={6}
                      sx={{
                          display:"flex",
                          justifyContent:"center"
                      }}>
                    Projects
                </Grid>)
            )}

        </Grid>
    )
}
